import React from "react"; // var React = require("react");
import ReactDOM from 'react-dom'; // var ReactDOM = require("react-dom");

function Card(){
  return(
    <div className="cards">
      <div className="card">
        <img src="" alt="tilepic"></img>
        <div className="card_info">
          <span className="card-category"></span>
          <h3 className="card_title"></h3>
          <a>
            <button>Watch Now</button>
          </a>
        </div>
      </div>
    </div>
  )
};

ReactDOM.render(
  <>
    <Card imgsrc="" title="" link="" sname=""/>
    <Card imgsrc="" title="" link="" sname=""/>
    <Card imgsrc="" title="" link="" sname=""/>
    <Card imgsrc="" title="" link="" sname=""/>
  </>, document.getElementById('root')
)
